wwv_flow_imp_page.create_page_da_action(
 p_id=>wwv_flow_imp.id(12602876465347715)
,p_event_id=>wwv_flow_imp.id(12602737347347714)
,p_event_result=>'TRUE'
,p_action_sequence=>10
,p_execute_on_page_init=>'N'
,p_name=>'Calculate Price On Button'
,p_action=>'NATIVE_EXECUTE_PLSQL_CODE'
,p_attribute_01=>wwv_flow_string.join(wwv_flow_t_varchar2(
'DECLARE',
'    l_sales_price   NUMBER;',
'    l_sql           clob;',
'    l_automl_model  varchar2(200);',
'BEGIN',
'    select model_name into l_automl_model',
'    from all_mining_models',
'    where model_name like ''NN_%''',
'    order by creation_date desc',
'    fetch first 1 row only;',
'',
'    l_sql := ''WITH vars AS (',
'        select '' || :P4_YEAR_STR || '' as YEAR_STR,',
'               '' || :P4_ASSESSTOT || '' as ASSESSTOT,',
'               '' || :P4_SANITDISTR || '' as SANITDISTR,',
'               '' || :P4_SCHOOLDIST || '' as SCHOOLDIST,',
'               '' || :P4_LAND_SQFT || '' as LAND_SQFT,',
'               '' || :P4_GROSS_SQFT || '' as GROSS_SQFT,',
'               '' || :P4_ASSESSLAND || '' as ASSESSLAND,',
'               '''''' || :P4_BUILDING_CLASS_AT_SALE || '''''' as BUILDING_CLASS_AT_SALE,',
'               '' || :P4_AGE_YEARS_2017 || '' as AGE_YEARS,',
'               '' || :P4_RESIDFAR || '' as RESIDFAR,',
'               '' || :P4_CT2010 || '' as CT2010 ',
'        from dual',
'    )',
'    SELECT PREDICTION(''||l_automl_model ||'' USING',
'               YEAR_STR,',
'               ASSESSTOT,',
'               SANITDISTR,',
'               SCHOOLDIST,',
'               LAND_SQFT,',
'               GROSS_SQFT,',
'               ASSESSLAND,',
'               BUILDING_CLASS_AT_SALE,',
'               AGE_YEARS,',
'               RESIDFAR,',
'               CT2010)',
'    FROM vars'';',
'',
'    execute immediate l_sql into l_sales_price;',
'',
':P4_SALES_PRICE := to_char(l_sales_price, ''FML999G999G999G999G990D00'');',
'END;'))
,p_attribute_02=>'P4_BUILDING_CLASS_AT_SALE,P4_YEAR_STR,P4_AGE_YEARS_2017,P4_SCHOOLDIST,P4_SANITDISTR,P4_ASSESSTOT,P4_ASSESSLAND,P4_LAND_SQFT,P4_GROSS_SQFT,P4_RESIDFAR,P4_CT2010'
,p_attribute_03=>'P4_SALES_PRICE'
,p_attribute_04=>'N'
,p_attribute_05=>'PLSQL'
,p_wait_for_result=>'Y'
);
