'    l_automl_model              varchar2(500);',
'    l_predict_sql               varchar2(4000);',
'BEGIN',
'',
'    select model_name into l_automl_model',
'    from all_mining_models',
'    where model_name like ''NN_%''',
'    order by creation_date desc',
'    fetch first 1 row only;',
'',
'    select YEAR_STR,',
'           ASSESSTOT,',
'           SANITDISTR,',
'           SCHOOLDIST,',
'           LAND_SQFT,',
'           GROSS_SQFT,',
'           ASSESSLAND,',
'           BUILDING_CLASS_AT_SALE,',
'           AGE_YEARS,',
'           RESIDFAR,',
'           CT2010 ',
'           into',
'            l_year_str,',
'            l_assesstot,',
'            l_sanitdistr,',
'            l_schooldist,',
'            l_land_sqft,',
'            l_gross_sqft,',
'            l_assessland,',
'            l_building_class_at_sale,',
'            l_age_years,',
'            l_residfar,',
'            l_ct2010',
'    from BROOKLYN_TEST',
'    where TRANSACTION_ID = :P4_PROPERTY_ID;',
'',
'    l_predict_sql := ''WITH vars AS (',
'        select *',
'        from BROOKLYN_TEST',
'        where TRANSACTION_ID = '' ||:P4_PROPERTY_ID ||',
'    '')',
'    SELECT PREDICTION(''|| l_automl_model ||'' USING',
'               * )',
'    FROM vars'';',
'',
'    execute immediate l_predict_sql into l_sales_price;',
'',
'',
':P4_SALES_PRICE := to_char(l_sales_price, ''FML999G999G999G999G990D00'');',
':P4_YEAR_STR := l_year_str;',
':P4_ASSESSTOT := l_assesstot;',
':P4_SANITDISTR := l_sanitdistr;',
':P4_SCHOOLDIST := l_schooldist;',
':P4_LAND_SQFT := l_land_sqft;',
':P4_GROSS_SQFT := l_gross_sqft;',
':P4_ASSESSLAND := l_assessland;',
':P4_BUILDING_CLASS_AT_SALE := l_building_class_at_sale;',
':P4_AGE_YEARS_2017 := l_age_years;',
':P4_RESIDFAR := l_residfar;',
':P4_CT2010 := l_ct2010;',
'END;'))
,p_attribute_02=>'P4_GROSS_SQFT,P4_BUILDING_CLASS_AT_SALE,P4_YEAR_STR,P4_AGE_YEARS_2017,P4_RESIDFAR,P4_CT2010,P4_PROPERTY_ID'
,p_attribute_03=>'P4_SALES_PRICE,P4_BUILDING_CLASS_AT_SALE,P4_YEAR_STR,P4_AGE_YEARS_2017,P4_SCHOOLDIST,P4_SANITDISTR,P4_ASSESSTOT,P4_ASSESSLAND,P4_LAND_SQFT,P4_GROSS_SQFT,P4_RESIDFAR,P4_CT2010'
,p_attribute_04=>'N'
,p_attribute_05=>'PLSQL'
,p_wait_for_result=>'Y'
);
